import React from 'react';

const Destinations = () => {
  return (
    <div class="container mx-auto py-10 pt-36">
    <h1 class="text-3xl border-solid font-bold mb-6">Foto Pengunjung</h1>
    <div class="grid grid-cols-3 gap-4">
      <div class="p-4">
        <img src="path_to_image_1.jpg" alt="Foto Pengunjung 1" class="rounded-lg w-full"></img>
      </div>
      <div class="p-4">
        <img src="path_to_image_2.jpg" alt="Foto Pengunjung 2" class="rounded-lg w-full"></img>
      </div>
      <div class="p-4">
        <img src="path_to_image_3.jpg" alt="Foto Pengunjung 3" class="rounded-lg w-full"></img>
      </div>
    </div>
  </div>
  );
};

export default Destinations;
